import axios from "axios";

const axiosApi = axios.create({
    baseURL: "http://localhost:8080/hk-sar-service/",
    headers: {
        'Content-Type': 'application/json',
        'Authorization': localStorage.getItem('token')
    },
});


export default axiosApi;
